import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./Navbar/Navbar";
import { Shop } from "./Pages/Shop";

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <main>
          <Routes>
            <Route path="/" element={<Shop />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
